import './App.css';

const data = [
  { name: "Anom",   age: 19, gender: "Male"},
  { name: "Megha",  age: 19, gender: "Famale"},
  { name: "Subham", age: 25, gender: "Male"},

]

function App() {
  return (
    <div className="App">
      <table>
        <tr>
          <th><img img={require('../img/1.png')} alt="Logo" /> </th>
          <th>Age</th>
          <th>Gender</th>
        </tr>
        {data.map((val, key) => {
          return ( 
            <tr key={key}>
              <td>{val.name}</td>
              <td>{val.age}</td>
              <td>{val.gender}</td>
            </tr>
          )
        })}
      </table>
    </div>
  );
}

export default App;
